import React from "react";
import ReactDOM from 'react-dom';
// import '../App.css';
import './ProjectSection.css';

import ThirtyDayAdulting from './ProjectMediaComponents/ThirtyDayAdulting.js';
import twentyfour from './project-media/24/twentyfour.js';
// sentence-mosaics
// dfa-website
// duquesne-incline
// ccc-website
// multitask
// fish
// bit-logo
// practing-form
// ap-art-portfolio
// ccc 
// acrylic-pour-painting-platform
// textile-work

function ProjectSections(props) {

    return (
        <div className='project-card'>
            <div className="one-line">
                <h3 className="one-line-item">{ props.title }</h3>
                <h5 className="one-line-item project-dates">{ props.dates }</h5>
            </div>
            <p>{ props.body }</p>
            {
                props.link === '' 
                ? <></>
                : <p>For more information, click <a className="link-color" href={ props.link } target="_blank">here</a></p> 
            }
            {/* <ThirtyDayAdulting/> */}
            {/* switch statement to change media based on project */}
            <p> { props.component } </p>
            <Project val = { props.component } />

        </div>
    );
}

function importAll(r) {
    return r.keys().map(r);
}

const Project = ({ val }) => {
    switch (val) {
        case 'thirty_day_adulting':
            return <ThirtyDayAdulting />;
        default:
            return null;
    }
};

export default ProjectSections;
